import SockJS from "sockjs-client";
import Stomp from "stompjs";
import LoginPage from "./components/public/login/LoginPage";
import Axios from "axios";
import QuestionModel from "./classess/QuestionModel";
import OptionModel from "./classess/OptionModel";
import QuizModel from "./classess/QuizModel";
import {PrivateRoute} from "./routes/privateRoute";
import HomePage from "./components/public/home/HomePage";
import EditQuizPage from "./components/edit_quiz/EditQuizPage";
import StartQuiz from "./components/public/grade/StartQuiz";
import Dashboard from "./components/admin/dashboard/Dashboard";
import Public from "./components/public/Public";
import Admin from "./components/admin/Admin";

